import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';
import Login from './component/Login';

import './App.css';
import NavBar from './component/NavBar';
import SingUp from './component/SingUp';

function App() {
  return (
    <>
      <BrowserRouter>
        <NavBar />
        <Route path='/login'>
          <Login />
        </Route>
        <Route path='/singup'>
          <SingUp />
        </Route>
      </BrowserRouter>
    </>
  );
}

export default App;
